import './App.css';
import { Routes,Route } from 'react-router-dom';
import Frontpage from './Pages/Frontpage';

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path='/' Component={Frontpage} />
        {/*<Route path='/chats' />*/}
      </Routes>
    </div>);
}

export default App;
